import{_ as r,a,b as o,c as t}from"./chunks/raccoonlab_micro_node.D7LVjAcI.js";import{_ as n,c as i,a8 as d,o as c}from"./chunks/framework.BDnHobkS.js";const C=JSON.parse('{"title":"RaccoonLab Mini/Micro Nodes","description":"","frontmatter":{},"headers":[],"relativePath":"ko/dronecan/raccoonlab_nodes.md","filePath":"ko/dronecan/raccoonlab_nodes.md"}'),s={name:"ko/dronecan/raccoonlab_nodes.md"};function l(h,e,p,m,f,b){return c(),i("div",null,e[0]||(e[0]=[d('<h1 id="raccoonlab-mini-micro-nodes" tabindex="-1">RaccoonLab Mini/Micro Nodes <a class="header-anchor" href="#raccoonlab-mini-micro-nodes" aria-label="Permalink to &quot;RaccoonLab Mini/Micro Nodes&quot;">​</a></h1><p>Mini/Micro are general purpose CAN nodes. The functionality of these devices depends on the firmware they are running. The default and most popular usage is as a PWM-CAN adapter to control ESCs and servos using CAN (Cyphal or DroneCAN) communication:</p><ul><li>Micro is the smallest node with 2 groups of pins (PWM/5V/GND) to control 2 servos or ESCs.</li><li>Mini v2: Features 2 x PWM/5V/GND for controlling servos or ESCs and 2 x PWM/FB/GND for controlling and receiving feedback from ESCs via UART.</li></ul><h2 id="cyphal-dronecan-can-pwm-adapter-firmware" tabindex="-1">Cyphal/DroneCAN CAN-PWM Adapter Firmware <a class="header-anchor" href="#cyphal-dronecan-can-pwm-adapter-firmware" aria-label="Permalink to &quot;Cyphal/DroneCAN CAN-PWM Adapter Firmware&quot;">​</a></h2><p><em>Cyphal/DroneCAN CAN-PWM</em> firmwares are the default for Mini and Micro nodes. These convert a typical PX4 CAN setpoint to PWM for controlling ESCs or servos.</p><p>Please refer to the corresponding RaccoonLab docs pages for details: <a href="https://docs.raccoonlab.co/guide/can_pwm/cyphal.html" target="_blank" rel="noreferrer">Cyphal/CAN-PWM</a>, <a href="https://docs.raccoonlab.co/guide/can_pwm/dronecan.html" target="_blank" rel="noreferrer">DroneCAN-PWM</a>.</p><p><img src="'+r+'" alt="Mini v2 Node with Servo and ESC"></p><h2 id="cyphal-dronecan-rangefinder-firmware" tabindex="-1">Cyphal &amp; DroneCAN Rangefinder Firmware <a class="header-anchor" href="#cyphal-dronecan-rangefinder-firmware" aria-label="Permalink to &quot;Cyphal &amp; DroneCAN Rangefinder Firmware&quot;">​</a></h2><p>The <em>Cyphal &amp; DroneCAN Rangefinder</em> firmware is a single firmware that can work in either Cyphal or DroneCAN mode. It supports LW20/I2C, Garmin Lite v3/I2C and TL-Luna/UART lidars. For details, please check the <a href="https://docs.raccoonlab.co/guide/can_pwm/rangefinder.html" target="_blank" rel="noreferrer">Rangefinder</a> page.</p><p><img src="'+a+'" alt="Mini v2 Node with servo and ESC"></p><h2 id="dronecan-fuel-sensor-firmware" tabindex="-1">DroneCAN Fuel Sensor Firmware <a class="header-anchor" href="#dronecan-fuel-sensor-firmware" aria-label="Permalink to &quot;DroneCAN Fuel Sensor Firmware&quot;">​</a></h2><p><em>DroneCAN fuel tank</em> firmware is based on the <a href="https://docs.raccoonlab.co/guide/as5600/" target="_blank" rel="noreferrer">AS5600 sensor board</a>. Please refer to <a href="https://docs.raccoonlab.co/guide/can_pwm/fuel_tank.html" target="_blank" rel="noreferrer">DroneCAN Fuel Tank</a> for details.</p><h2 id="dronecan-servo-gripper-firmware" tabindex="-1">DroneCAN Servo Gripper Firmware <a class="header-anchor" href="#dronecan-servo-gripper-firmware" aria-label="Permalink to &quot;DroneCAN Servo Gripper Firmware&quot;">​</a></h2><p><em>DroneCAN servo gripper</em> is part of a <a href="https://github.com/RaccoonlabDev/mini_v2_node" target="_blank" rel="noreferrer">Mini Node Template Application</a>. Please refer to <a href="https://docs.raccoonlab.co/guide/can_pwm/servo_gripper.html" target="_blank" rel="noreferrer">DroneCAN Servo Gripper</a> for details.</p><h2 id="custom-firmware" tabindex="-1">Custom Firmware <a class="header-anchor" href="#custom-firmware" aria-label="Permalink to &quot;Custom Firmware&quot;">​</a></h2><p><strong>Custom firmware</strong> can be developed by anyone. If you require custom features, you can use the <a href="https://github.com/RaccoonlabDev/mini_v2_node" target="_blank" rel="noreferrer">Mini Node Template Application</a>. You can configure the external pins to work in UART, I2C or ADC mode. From the box, it supports basic Cyphal/DroneCAN features. It has publishers and subscribers as an example.</p><h2 id="which-node-to-choose" tabindex="-1">Which node to choose? <a class="header-anchor" href="#which-node-to-choose" aria-label="Permalink to &quot;Which node to choose?&quot;">​</a></h2><p>The differences between <a href="https://docs.raccoonlab.co/guide/can_pwm/can_pwm_mini_v2.html" target="_blank" rel="noreferrer">Mini v2</a> and <a href="https://docs.raccoonlab.co/guide/can_pwm/can_pwm_micro.html" target="_blank" rel="noreferrer">Micro</a> are summarized in the table below. For more details, please refer to the corresponding pages.</p><table tabindex="0"><thead><tr><th></th><th></th><th>Mini v2</th><th>Micro</th></tr></thead><tbody><tr><td></td><td>이미지</td><td><img src="'+o+'" alt="RaccoonLab Mini v2 Node"></td><td><img src="'+t+'" alt="RaccoonLab Micro Node"></td></tr><tr><td>1</td><td>Input voltage</td><td>5.5V – 30V</td><td>4.5V – 5.5V</td></tr><tr><td>2</td><td>DC-DC</td><td>Yes</td><td>No</td></tr><tr><td>3</td><td>Groups of pins</td><td>- PWM+5V+GND x2 - PWM+FB+GND x2</td><td>- PWM+5V+GND x2</td></tr><tr><td>4</td><td>CAN connectors</td><td>- UCANPHY Micro x2 - 6-pin Molex x2</td><td>- UCANPHY Micro x2</td></tr><tr><td>5</td><td>SWD interface</td><td>+</td><td>+</td></tr><tr><td>6</td><td>Size, LxWxH, mm</td><td>42x35x12</td><td>20x10x5</td></tr><tr><td>7</td><td>Mass, g</td><td>5</td><td>3</td></tr></tbody></table><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p><a href="https://raccoonlab.co/store" target="_blank" rel="noreferrer">RaccoonLab Store</a></p><p><a href="https://cyphal.store/search?q=raccoonlab" target="_blank" rel="noreferrer">Cyphal store</a></p>',22)]))}const _=n(s,[["render",l]]);export{C as __pageData,_ as default};
